import "./Card.css";
import { FcCloseUpMode, FcHome } from "react-icons/fc";

function CardConteiner() {
  return (
    <div className="cardCont">
      <img
        alt="product"
        src="https://ychef.files.bbci.co.uk/976x549/p04tx3m6.jpg"
      />
      <div>
        <p> Hello World</p>
        <span>
          <FcCloseUpMode />
        </span>
        <span>
          <FcHome />
        </span>
      </div>
    </div>
  );
}

export { CardConteiner };
